a526bb13-02e6-4c17-85af-aecd0dcbedcd	GwJGdLAXWb	Using Outline for self-hosting knowledge base	This guide is for creating an on-premise (self-hosted) knowledge base using **Outline** running through **Docker**.\n\nThis guide is based on: <https://docs.getoutline.com/s/hosting>\n\n### Pre-requisites\n\n* Docker for spinning **Outline** container\n* **NGROK** for free **HTTPS** domain\n* **Slack / Google / Azure** for **SSO**\n\n## Design\n\n```mermaidjs\ngraph TB\n    subgraph "DNS & Domain Management"\n        A1[Cloudflare DNS]\n        A2[AWS Route 53]\n        A3[NGROK Tunnel]\n        A1 -.alternative.-> Domain[Custom Domain]\n        A2 -.alternative.-> Domain\n        A3 -.alternative.-> Domain\n    end\n\n    subgraph "User Access"\n        User[End Users]\n        SlackSSO[Slack Workspace<br/>SSO Provider]\n    end\n\n    subgraph "AWS Cloud"\n        subgraph "EC2 Instance"\n            subgraph "Docker Environment"\n                DC[Docker Compose]\n                \n                subgraph "Application Containers"\n                    Outline[Outline App<br/>Port 3000]\n                    Redis[Redis Cache<br/>Port 6379]\n                    Postgres[(PostgreSQL DB<br/>Port 5432)]\n                end\n                \n                subgraph "Storage"\n                    S3Local[Local Storage<br/>or S3 Integration]\n                end\n                \n                subgraph "Optional Services"\n                    Nginx[Nginx Reverse Proxy<br/>Port 80/443]\n                    LetsEncrypt[Let's Encrypt<br/>SSL Certificates]\n                end\n            end\n        end\n        \n        subgraph "AWS Services"\n            S3Bucket[S3 Bucket<br/>File Storage]\n            EBS[EBS Volume<br/>Persistent Storage]\n            SG[Security Group<br/>Firewall Rules]\n        end\n    end\n\n    subgraph "External Services"\n        SlackAPI[Slack OAuth API]\n    end\n\n    %% User Flow\n    User -->|1. Access KB| Domain\n    Domain -->|2. Route Traffic| Nginx\n    \n    %% SSL/Proxy\n    Nginx -->|SSL Termination| Outline\n    LetsEncrypt -.->|SSL Certs| Nginx\n    \n    %% Authentication Flow\n    User -.->|3. Login Request| Outline\n    Outline -.->|4. OAuth Redirect| SlackSSO\n    SlackSSO -.->|5. Authenticate| SlackAPI\n    SlackAPI -.->|6. Return Token| Outline\n    Outline -.->|7. Create Session| User\n    \n    %% Application Dependencies\n    DC -->|Orchestrates| Outline\n    DC -->|Orchestrates| Redis\n    DC -->|Orchestrates| Postgres\n    DC -->|Orchestrates| Nginx\n    \n    Outline -->|Cache Sessions| Redis\n    Outline -->|Store Data| Postgres\n    Outline -->|Store Files| S3Local\n    S3Local -.->|Sync/Backup| S3Bucket\n    \n    %% Infrastructure\n    Postgres -->|Persist Data| EBS\n    SG -->|Port 80/443| Nginx\n    SG -->|Outbound| SlackAPI\n    \n    %% Styling\n    classDef aws fill:#FF9900,stroke:#232F3E,stroke-width:2px,color:#fff\n    classDef docker fill:#2496ED,stroke:#1D63ED,stroke-width:2px,color:#fff\n    classDef external fill:#4A154B,stroke:#36123C,stroke-width:2px,color:#fff\n    classDef dns fill:#F38020,stroke:#C96A1B,stroke-width:2px,color:#fff\n    classDef storage fill:#569A31,stroke:#3F7024,stroke-width:2px,color:#fff\n    \n    class S3Bucket,EBS,SG,A2 aws\n    class DC,Outline,Redis,Postgres,Nginx docker\n    class SlackSSO,SlackAPI external\n    class A1,A3,Domain dns\n    class S3Local storage\n```\n\n\n\\	2025-10-20 12:49:16.867+00	2025-10-20 12:49:16.867+00	4698e112-c591-46f4-a92b-26e41d5b01e0	536ea67a-0c1a-4692-bf77-e3d0be7e5faa	35792980-e98e-4eaf-b7a7-201f13ab4b7c	f4ec95e8-24e2-4484-b927-a12ae26fa3e2	1	'/s/hosting':35 '1':185 '1d63ed':288 '2':190 '232f3e':276 '2496ed':286 '2px':280,292,304,316,328 '3':206 '3000':115 '36123c':300 '3f7024':324 '4':211 '4a154b':298 '5':216 '53':68 '5432':125 '569a31':322 '6':220 '6379':120 '7':225 '80/443':144,265 'a1':62,72,349 'a2':65,77,335 'a3':69,80,350 'access':86,186 'altern':73,78,81 'api':180 'app':113 'applic':109,229 '