attrs": {"level": 2}, "content": [{"text": "Supporting Software", "type": "text", "marks": [{"type": "strong"}]}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "PostgreSQL", "type": "text", "marks": [{"type": "strong"}, {"type": "link", "attrs": {"href": "https://www.postgresql.org/", "title": null}}]}, {"text": " (v12+)", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Redis", "type": "text", "marks": [{"type": "strong"}, {"type": "link", "attrs": {"href": "https://redis.io/", "title": null}}]}, {"text": " (v4+)", "type": "text"}]}]}]}, {"type": "heading", "attrs": {"level": 2}, "content": [{"text": "Hardware", "type": "text", "marks": [{"type": "strong"}]}]}, {"type": "heading", "attrs": {"level": 3}, "content": [{"text": "CPU", "type": "text", "marks": [{"type": "strong"}]}]}, {"type": "paragraph", "content": [{"text": "Outline will run on relatively low powered hardware. CPU requirements are dependent on the number of users and expected workload. Your workload is influenced by factors such as - but not limited to - how many users are online, how active your users are, whether they are viewing and typing in documents.", "type": "text"}]}, {"type": "heading", "attrs": {"level": 3}, "content": [{"text": "Memory", "type": "text", "marks": [{"type": "strong"}]}]}, {"type": "paragraph", "content": [{"text": "A minimum of 512MB of memory is required, depending on the number of users 1GB or more is recommended.", "type": "text"}]}, {"type": "heading", "attrs": {"level": 2}, "content": [{"text": "Other Dependencies", "type": "text", "marks": [{"type": "strong"}]}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "A dedicated domain or sub-domain to host Outline on (e.g. docs.yourcompany.com)", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "A compatible ", "type": "text"}, {"text": "Authentication Provider", "type": "text", "marks": [{"type": "strong"}, {"type": "link", "attrs": {"href": "https://docs.getoutline.com/s/hosting/doc/authentication-7ViKRmRY5o", "title": null}}]}]}]}]}, {"type": "heading", "attrs": {"level": 3}, "content": [{"text": "Pre-requisites", "type": "text"}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Docker for spinning ", "type": "text"}, {"text": "Outline", "type": "text", "marks": [{"type": "strong"}]}, {"text": " container", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "NGROK", "type": "text", "marks": [{"type": "strong"}]}, {"text": " for free ", "type": "text"}, {"text": "HTTPS", "type": "text", "marks": [{"type": "strong"}]}, {"text": " domain", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Slack / Google / Azure", "type": "text", "marks": [{"type": "strong"}]}, {"text": " for ", "type": "text"}, {"text": "SSO", "type": "text", "marks": [{"type": "strong"}]}]}]}]}, {"type": "heading", "attrs": {"level": 2}, "content": [{"text": "Steps:", "type": "text"}]}, {"type": "checkbox_list", "content": [{"type": "checkbox_item", "attrs": {"checked": false}, "content": [{"type": "paragraph", "content": [{"text": "Download Docker", "type": "text"}]}, {"type": "checkbox_list", "content": [{"type": "checkbox_item", "attrs": {"checked": false}, "content": [{"type": "paragraph", "content": [{"text": "Create ", "type": "text"}, {"text": "docker-compose.yml", "type": "text", "marks": [{"type": "strong"}]}]}]}, {"type": "checkbox_item", "attrs": {"checked": false}, "content": [{"type": "paragraph", "content": [{"text": "Copy the outline template for ", "type": "text"}, {"text": "docker-compose.yml", "type": "text", "marks": [{"type": "strong"}]}, {"text": ". Update accordingly", "type": "text"}]}]}]}]}]}, {"type": 