1be60ff4-6c3c-4ea9-ba90-96bd0a5da883	stsmhh3pCX	1. What is CI/CD	Reference: <https://cloud.google.com/blog/topics/developers-practitioners/devops-and-cicd-google-cloud-explained>\n\n\\\n\\\n## **What is CI/CD?**\n\nContinuous Integration (CI), at its core, is about getting feedback early and often, which makes it possible to identify and correct problems early in the development process. With CI, you integrate your work frequently, often multiple times a day, instead of waiting for one large integration later on. Each integration is verified with an automated build, which enables you to detect integration issues as quickly as possible and reduce problems downstream.\n\nContinuous Delivery (CD) extends CI. CD is about packaging and preparing the software with the goal of delivering incremental changes to users.  Deployment strategies such as red/black and canary deployments can help reduce release risk and increase confidence in releases. CD makes the release process safer, lower risk, faster, and, when done well, boring. Once  deployments are made painless with CD, developers can focus on writing code, not tweaking deployment scripts.\n\n ![https://storage.googleapis.com/gweb-cloudblog-publish/images/CloudBuildSketchnote.max-2000x2000.png](/api/attachments.redirect?id=f1ec9723-5bf6-42da-996d-53c737d73700 " =2000x1125")\n\nClick to enlarge\n\n## **How has the application development landscape changed?**\n\nMuch has changed in the app development space recently, and you’ll want to take these changes into account as part of your CI/CD strategy.\n\n* Hybrid and multi-cloud deployments - Large enterprises want to deploy applications in hybrid cloud environments, with tools and services that don't lock them into a specific vendor. \n* The shift from monolith to microservices - Teams are breaking down large monoliths into microservices for greater agility. This makes it possible for different teams to use different languages, tech stacks, development lifecycles, which means deployment patterns, tooling needs, and scaling patterns are changing.\n* Cloud-native applications - It’s not just VMs anymore; companies are shifting paradigms and embracing  serverless, containers, and Kubernetes. While simplifying some aspects of app development, this move adds complexity in other areas. How do you handle rollbacks? Canary deployments? It’s different now.  \n\nIdeally, developers should be focused on their code, not on ushering their changes through a CI/CD process.  CI/CD steps should be triggered and run behind the scenes as soon as code is checked in. So, your CI/CD pipeline should support:\n\n* Packaging source code\n* Automated unit and integration tests\n* Consistent build environments\n* Approvals before deploying to production\n* Blue/green and canary roll-outs \n\nThat’s where Cloud Build comes in. \n\n## **Google Cloud DevOps overview**\n\n### **Cloud Build**\n\nCloud Build is a fully-managed CI/CD platform that lets you build, test, and deploy across hybrid and multi-cloud environments that include VMs, serverless, Kubernetes, and Firebase. Cloud Build can import source code from Cloud Storage, [Cloud Source Repositories](https://source.cloud.google.com/onboarding/welcome), GitHub, or Bitbucket; execute a build to your specifications; and produce artifacts such as Docker container images or Java archives.  \n\nCloud Build executes your build as a series of build steps, with each step run in a Docker container. A build step can do anything that can be done from a container irrespective of the environment. To perform your tasks, you can either use the [supported build steps](https://cloud.google.com/build/docs/deploying-builds/deploy-cloud-run) provided by Cloud Build or [write your own build steps](https://cloud.google.com/build/docs/configuring-builds/use-community-and-custom-builders). As a part of the build step, Cloud Build deploys the app to a platform of your choice. You also have the ability to perform deep security scans within the CI/CD pipeline using [Binary Authorization](https://cloud.google.com/binary-authorization) and ensure only trusted container images are deployed to production. \n\n[Cloud Build private pools](https://cloud.google.com/build/docs/private-pools/private-pools-overview) help you meet enterprise security and compliance requirements. These are private, dedicated pools of workers that offer greater customization over the build environment, including the ability to access resources in a private network. For instance, you can trigger fully managed DevOps workflows from source code repositories hosted in private networks, including Github Enterprise.\n\n### **Cloud Code**\n\nIf you are working entirely in a cloud-native environment, then you’ll want to use Cloud Code to kick off your CI/CD pipeline. Use [Cloud Code](https://cloud.google.com/code) in your IDE; it comes with tools to help you write, run, and debug cloud-native applications quickly and easily. Then push your code to Cloud Build for the build process, package it in the [Artifact Registry](https://cloud.google.com/artifact-registry), and run it on [GKE](https://cloud.google.com/kubernetes-engine/) or Cloud Run. You can get all the visibility and metrics you want for the deployment in [Google Cloud’s operations suite](https://cloud.google.com/products/operations). \n\n### **Cloud Deploy**\n\n[​​Google Cloud Deploy](https://cloud.google.com/blog/products/devops-sre/google-cloud-deploy-automates-deploys-to-gke) (in preview) is a managed, opinionated continuous delivery service that makes continuous delivery to GKE easier, faster, and more reliable. It has built in security controls and it can be integrated with your existing DevOps ecosystem. \n\n### **Cloud Shell Editor**\n\n[Cloud Shell Editor](https://cloud.google.com/blog/products/application-development/introducing-cloud-shell-editor), powered by the Eclipse Theia IDE platform, extends [Cloud Shell](https://cloud.google.com/shell) with an online preconfigured cloud development environment that includes: \n\n* Local emulators for Kubernetes and serverless, and\n* Command line tools for working with cloud-native apps\n\nInterested in getting started with CI/CD on Google Cloud? Check out the documentation [here](https://cloud.google.com/docs/ci-cd). For more #GCPSketchnote and similar cloud content, follow me on twitter [@pvergadia](https://twitter.com/pvergadia) and keep an eye out on [thecloudgirl.dev](http://thecloudgirl.dev/)	2025-10-21 16:41:49.056+00	2025-12-13 21:46:19.385+00	4698e112-c591-46f4-a92b-26e41d5b01e0	536ea67a-0c1a-4692-bf77-e3d0be7e5faa	8b10946f-48ee-4f81-af38-abac2e86ac2e	f4ec95e8-24e2-4484-b927-a12ae26fa3e2	6	'/)':865 '/artifact-registry),':698 '/binary-authorization)':554 '/blog/products/application-development/introducing-cloud-shell-editor),':784 '/blog/products/devops-sre/google-cloud-deploy-automates-deploys-to-gke)':739 '/blog/topics/developers-practitioners/devops-and-cicd-google-cloud-explained':11 '/build/docs/configuring-builds/use-community-and-custom-builders).':516 '/build/docs/deploying-builds/deploy-cloud-run)':503 '/build/docs/private-pools/private-pools-overview)':571 '/code)':657 '/docs/ci-cd).':840 '/gweb-cloudblog-publish/images/cloudbuildsketchnote.max-2000x2000.png](/api/attachments.redirect?id=f1ec9723-5bf6-42da-996d-53c737d73700':159 '/kubernetes-engine/)':706 '/onboarding/welcome),':432 '/products/operations).':731 '/pvergadia)':855 '/shell)':797 '1':1A '2000x1125':160 'abil':539,597 'access':599 'account':189 'across':404 'add':297 'agil':241 'also':536 'anymor':277 'anyth':477 'app':176,293,528,823 'applic':167,207,271,675 'approv':364 'archiv':452 'area':301 'artifact':444,694 'aspect':291 'author':551 'autom':69,356 'behind':337 'binari':550 'bitbucket':435 'blue/green':369 'bore':139 'break':233 'build':70,362,379,387,389,400,419,438,454,457,462,473,499,507,512,522,525,566,593,685,688 'built':762 'canari':114,307,371 'cd':88,91,126,146 'chang':105,170,173,187,267,325 'c