638f9964-be10-4a6e-b028-7969e5352b1a	aZAJvo45Eg	MVC	\\\n	2025-12-02 18:28:47.052+00	2025-12-03 18:20:42.041+00	4698e112-c591-46f4-a92b-26e41d5b01e0	536ea67a-0c1a-4692-bf77-e3d0be7e5faa	f9ce137d-4775-44a8-b919-b4c8bded194e	f4ec95e8-24e2-4484-b927-a12ae26fa3e2	3	'mvc':1A	\N	f4ec95e8-24e2-4484-b927-a12ae26fa3e2	{f4ec95e8-24e2-4484-b927-a12ae26fa3e2}	2025-12-02 18:28:47.189+00	\N	\N	f	16.0.0	2	f	\N	\N	\\	f	\N	t	\N	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "The", "type": "text"}, {"text": " MVC pattern ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "suggests splitting the code into 3 components. While creating the class/file of the application, the developer must categorize it into one of the following three layers:", "type": "text"}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Model:", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": " This component stores the application data. It has no knowledge about the interface. The model is responsible for handling the domain logic(real-world business rules) and communication with the database and network layers.", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "View: ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "It", "type": "text"}, {"text": " ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "is the", "type": "text"}, {"text": " ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "UI(User Interface) layer that holds components that are visible on the screen. Moreover, it provides the visualization of the data stored in the Model and offers interaction to the user.", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Controller: ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "This component establishes the relationship between the ", "type": "text"}, {"text": "View", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": " and the ", "type": "text"}, {"text": "Model. ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "It contains the core application logic and gets informed of the user’s behavior and updates the Model as per the need.", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "In spite of applying MVC schema to give a modular design to the application, code layers do depend on each other. In this pattern, ", "type": "text"}, {"text": "View ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "and ", "type": "text"}, {"text": "Controller ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "both depend upon the ", "type": "text"}, {"text": "Model. ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "Multiple approaches are possible to apply the MVC pattern in the project:", "type": "text"}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Approach 1:", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": " Activities and fragments can perform the role of Controller and are responsible for updating the View.", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Approach 2:", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": " Use activity or fragments as views and controller while Model will be a separate class that does not extend any Android class.", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "In ", "type": "text"}, {"text": "MVC architecture", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": ", application data is updated by the controller and View gets the data. Since the", "type": "text"}, {"text": " Model", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": " component is separated, it could be tested independently of the UI. Further, if the ", "type": "text"}, {"text": "View", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": " layer respects the ", "type": "text"}, {"text": "single responsibility principle", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": " then their role is just to update the Controller for every user event and just display data from the Model, without implementing any business logic. In this case, UI tests should be enough to cover the functionalities of the View.", "type": "text"}]}, {"type": "heading", "attrs": {"level": 2}, "content": [{"text": "Example of MVC Architecture", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "To understand the implementation of the MVC architecture pattern more clearly, here is a simple example of an android application. This application will have 3 buttons and each one of them displays the count that how many times the user has clicked that particular button. To develop this application the code has been separated in the following manner:", "type": "text"}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Controller and View ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "will be handled by the Activity. Whenever the user clicks the buttons, activity directs the Model to handle the further operations. The activity will act as an ", "type": "text"}, {"text": "observer", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": ".", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "The ", "type": "text"}, {"text": "Model ", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}, {"text": "will be a separate class that contains the data to be displayed. The operations on the data will be performed by functions 