a9cd1a54-8711-4809-a92c-c2a12251856d	1. What is CI/CD	\N	2025-12-13 21:46:19.385+00	2025-12-13 21:46:20.301+00	f4ec95e8-24e2-4484-b927-a12ae26fa3e2	1be60ff4-6c3c-4ea9-ba90-96bd0a5da883	16.0.0	2	{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "Reference: ", "type": "text"}, {"text": "https://cloud.google.com/blog/topics/developers-practitioners/devops-and-cicd-google-cloud-explained", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/blog/topics/developers-practitioners/devops-and-cicd-google-cloud-explained", "title": null}}]}]}, {"type": "paragraph", "content": []}, {"type": "paragraph"}, {"type": "heading", "attrs": {"level": 2}, "content": [{"text": "What is CI/CD?", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}]}, {"type": "paragraph", "content": [{"text": "Continuous Integration (CI), at its core, is about getting feedback early and often, which makes it possible to identify and correct problems early in the development process. With CI, you integrate your work frequently, often multiple times a day, instead of waiting for one large integration later on. Each integration is verified with an automated build, which enables you to detect integration issues as quickly as possible and reduce problems downstream.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Continuous Delivery (CD) extends CI. CD is about packaging and preparing the software with the goal of delivering incremental changes to users.  Deployment strategies such as red/black and canary deployments can help reduce release risk and increase confidence in releases. CD makes the release process safer, lower risk, faster, and, when done well, boring. Once  deployments are made painless with CD, developers can focus on writing code, not tweaking deployment scripts.", "type": "text"}]}, {"type": "paragraph", "content": [{"type": "image", "attrs": {"alt": "https://storage.googleapis.com/gweb-cloudblog-publish/images/CloudBuildSketchnote.max-2000x2000.png", "src": "/api/attachments.redirect?id=f1ec9723-5bf6-42da-996d-53c737d73700", "width": 2000, "height": 1125}}]}, {"type": "paragraph", "content": [{"text": "Click to enlarge", "type": "text"}]}, {"type": "heading", "attrs": {"level": 2}, "content": [{"text": "How has the application development landscape changed?", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}]}, {"type": "paragraph", "content": [{"text": "Much has changed in the app development space recently, and you’ll want to take these changes into account as part of your CI/CD strategy.", "type": "text"}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Hybrid and multi-cloud deployments - Large enterprises want to deploy applications in hybrid cloud environments, with tools and services that don't lock them into a specific vendor. ", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "The shift from monolith to microservices - Teams are breaking down large monoliths into microservices for greater agility. This makes it possible for different teams to use different languages, tech stacks, development lifecycles, which means deployment patterns, tooling needs, and scaling patterns are changing.", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Cloud-native applications - It’s not just VMs anymore; companies are shifting paradigms and embracing  serverless, containers, and Kubernetes. While simplifying some aspects of app development, this move adds complexity in other areas. How do you handle rollbacks? Canary deployments? It’s different now.  ", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "Ideally, developers should be focused on their code, not on ushering their changes through a CI/CD process.  CI/CD steps should be triggered and run behind the scenes as soon as code is checked in. So, your CI/CD pipeline should support:", "type": "text"}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Packaging source code", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Automated unit and integration tests", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Consistent build environments", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Approvals before deploying to production", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Blue/green and canary roll-outs ", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "That’s where Cloud Build comes in. ", "type": "text"}]}, {"type": "heading", "attrs": {"level": 2}, "content": [{"text": "Google Cloud DevOps overview", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}]}, {"type": "heading", "attrs": {"level": 3}, "content": [{"text": "Cloud Build", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}]}, {"type": "paragraph", "content": [{"text": "Cloud Build is a fully-managed CI/CD platform that lets you build, test, and deploy across hybrid and multi-cloud environments that include VMs, serverless, Kubernetes, and Firebase. Cloud Build can import source code from Cloud Storage, ", "type": "text"}, {"text": "Cloud Source Repositories", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://source.cloud.google.com/onboarding/welcome", "title": null}}]}, {"text": ", GitHub, or Bitbucket; execute a build to your specifications; and produce artifacts such as Docker container images or Java archives.  ", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Cloud Build executes your build as a series of build steps, with each step run in a Docker container. A build step can do anything that can be done from a container irrespective of the environment. To perform your tasks, you can either use the ", "type": "text"}, {"text": "supported build steps", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/build/docs/deploying-builds/deploy-cloud-run", "title": null}}]}, {"text": " provided by Cloud Build or ", "type": "text"}, {"text": "write your own build steps", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/build/docs/configuring-builds/use-community-and-custom-builders", "title": null}}]}, {"text": ". As a part of the build step, Cloud Build deploys the app to a platform of your choice. You also have the ability to perform deep security scans within the CI/CD pipeline using ", "type": "text"}, {"text": "Binary Authorization", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/binary-authorization", "title": null}}]}, {"text": " and ensure only trusted container images are deployed to production. ", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "Cloud Build private pools", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/build/docs/private-pools/private-pools-overview", "title": null}}]}, {"text": " help you meet enterprise security and compliance requirements. These are private, dedicated pools of workers that offer greater customization over the build environment, including the ability to access resources in a private network. For instance, you can trigger fully managed DevOps workflows from source code repositories hosted in private networks, including Github Enterprise.", "type": "text"}]}, {"type": "heading", "attrs": {"level": 3}, "content": [{"text": "Cloud Code", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}]}, {"type": "paragraph", "content": [{"text": "If you are working entirely in a cloud-native environment, then you’ll want to use Cloud Code to kick off your CI/CD pipeline. Use ", "type": "text"}, {"text": "Cloud Code", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/code", "title": null}}]}, {"text": " in your IDE; it comes with tools to help you write, run, and debug cloud-native applications quickly and easily. Then push your code to Cloud Build for the build process, package it in the ", "type": "text"}, {"text": "Artifact Registry", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/artifact-registry", "title": null}}]}, {"text": ", and run it on ", "type": "text"}, {"text": "GKE", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/kubernetes-engine/", "title": null}}]}, {"text": " or Cloud Run. You can get all the visibility and metrics you want for the deployment in ", "type": "text"}, {"text": "Google Cloud’s operations suite", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/products/operations", "title": null}}]}, {"text": ". ", "type": "text"}]}, {"type": "heading", "attrs": {"level": 3}, "content": [{"text": "Cloud Deploy", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}]}, {"type": "paragraph", "content": [{"text": "​​Google Cloud Deploy", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/blog/products/devops-sre/google-cloud-deploy-automates-deploys-to-gke", "title": null}}]}, {"text": " (in preview) is a managed, opinionated continuous delivery service that makes continuous delivery to GKE easier, faster, and more reliable. It has built in security controls and it can be integrated with your existing DevOps ecosystem. ", "type": "text"}]}, {"type": "heading", "attrs": {"level": 3}, "content": [{"text": "Cloud Shell Editor", "type": "text", "marks": [{"type": "strong", "attrs": {}}]}]}, {"type": "paragraph", "content": [{"text": "Cloud Shell Editor", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/blog/products/application-development/introducing-cloud-shell-editor", "title": null}}]}, {"text": ", powered by the Eclipse Theia IDE platform, extends ", "type": "text"}, {"text": "Cloud Shell", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/shell", "title": null}}]}, {"text": " with an online preconfigured cloud development environment that includes: ", "type": "text"}]}, {"type": "bullet_list", "content": [{"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Local emulators for Kubernetes and serverless, and", "type": "text"}]}]}, {"type": "list_item", "content": [{"type": "paragraph", "content": [{"text": "Command line tools for working with cloud-native apps", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "Interested in getting started with CI/CD on Google Cloud? Check out the documentation ", "type": "text"}, {"text": "here", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://cloud.google.com/docs/ci-cd", "title": null}}]}, {"text": ". For more #GCPSketchnote and similar cloud content, follow me on twitter ", "type": "text"}, {"text": "@pvergadia", "type": "text", "marks": [{"type": "link", "attrs": {"href": "https://twitter.com/pvergadia", "title": null}}]}, {"text": " and keep an eye out on ", "type": "text"}, {"text": "thecloudgirl.dev", "type": "text", "marks": [{"type": "link", "attrs": {"href": "http://thecloudgirl.dev/", "title": null}}]}]}]}	\N	\N	\N	\N	{f4ec95e8-24e2-4484-b927-a12ae26fa3e2}
